import styled from 'styled-components';

export const Container = styled.div`
width: 300px;
height: 100 px;
background: #20295F;

display: flex;
flex-direction: column;
justify-content: space-around;
align-self: flex-end;
align-items: flex-end;
border-radius: 5px;

img {
    width: 25px;
    height: 25px;
}

span {
    color:#FFF;
    font-weight: bold;
}

`
